--
-- 表的结构 `pm_rl_wfprocess`
--

CREATE TABLE `pm_rl_wfprocess` (
  `Pk_WfProcess` varchar(32) COLLATE utf8mb4_bin NOT NULL,
  `ProcessCode` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL,
  `ProcessName` varchar(512) COLLATE utf8mb4_bin DEFAULT NULL,
  `ProcessType` tinyint(2) NOT NULL DEFAULT '0',
  `WorkflowType` tinyint(1) NOT NULL DEFAULT '0' COMMENT '0: automatic workflow (no participant) 1: single participant workflow 2: multiple participant workflow',
  `AccessLevel` tinyint(2) DEFAULT '0' COMMENT '0:Internal;1:Public',
  `Description` longtext COLLATE utf8mb4_bin,
  `Keywords` varchar(1024) COLLATE utf8mb4_bin DEFAULT NULL,
  `Author` varchar(512) COLLATE utf8mb4_bin DEFAULT NULL,
  `AuthorId` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL,
  `Lastupdate` datetime DEFAULT NULL,
  `Status` tinyint(2) DEFAULT '0' COMMENT '0:unlocked;1:locked',
  `Version` varchar(512) COLLATE utf8mb4_bin NOT NULL COMMENT 'Released version number',
  `Releaser` varchar(512) COLLATE utf8mb4_bin NOT NULL COMMENT 'Organization or persion who release current version.',
  `ReleaserId` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL,
  `ReleaseStatement` longtext COLLATE utf8mb4_bin COMMENT 'Version statement for descriping current what''s new on current version.',
  `ReleaseDate` datetime NOT NULL COMMENT 'Release date and time',
  `Deprecated` tinyint(1) NOT NULL DEFAULT '0' COMMENT '1:deprecated(not use any more);0:applying online',
  `TrialPeriod` smallint(6) DEFAULT '0' COMMENT '0: no trial;1: 1 month trial; 2: 3 months;  3: 6 months; 4: 9 months; 5: 12 months;',
  `PurchasePrice` decimal(18,2) DEFAULT '0.00' COMMENT 'Price of purchase this processthe process on process market',
  `UsagePrice` decimal(18,2) DEFAULT '0.00' COMMENT 'Price of using this process once',
  `Fk_Parent` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT 'Parent folder',
  `Fk_Owner` varchar(32) COLLATE utf8mb4_bin NOT NULL,
  `ProcessContent` longtext COLLATE utf8mb4_bin COMMENT 'JSON format of released process definition'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin ROW_FORMAT=DYNAMIC;

